	select '-----------------------------';

	drop table if exists temp.delete_records;
	create temporary table temp.delete_records (RecipeId int, [Number] int, RecipeRevisionId int, RecipeDetailId int);

	-- Any RecipeIds between 500 and 999 that are not in our test set should be deleted (this range is reserved for integration testing)
	insert into temp.delete_records (RecipeId, [Number])
	select r.RecipeId, r.[Number]
	from prs.Recipe r 
	where ((r.[Number] between 500 and 999) or (r.[Number] in (0,1)));

	-- Any Revisions on Recipe Numbers between 500 and 999 that are not in our test set should be deleted
	insert into temp.delete_records (RecipeId, RecipeRevisionId)
	select distinct rr.RecipeId, rr.RecipeRevisionId
	from 
		prs.RecipeRevision rr
		inner join temp.delete_records d
		on rr.RecipeId = d.RecipeId;

	-- delete details
	delete from prs.RecipeDetail as rd
		where rd.RecipeRevisionId in (select RecipeRevisionId from temp.delete_records);
	select 'delete details: ' || changes();

	-- delete revisions
	delete from prs.RecipeRevision as rr
		where rr.RecipeRevisionId in (select RecipeRevisionId from temp.delete_records);
	select 'delete revisions: ' || changes();

	-- delete recipes
	delete from prs.Recipe as r
		where r.RecipeId in (select RecipeId from temp.delete_records);
	select 'delete recipes: ' || changes();
	
	-- insert recipes
	insert into prs.Recipe ([Number], [Name], [Description], Notes, ActiveRevision, CreationDate, UpdatedDate, CreatedBy, UpdatedBy, IsArchived, IsDeleted)
	select t.[Number], t.[Name], t.[Description], t.Notes, -1 as ActiveRevision, t.CreationDate, t.UpdatedDate, t.CreatedBy, t.UpdatedBy, t.IsArchived, t.IsDeleted
	from temp.t t;
	select 'insert recipes: ' || changes();

	-- propagate new RecipeIds to our test data set
	update temp.t set RecipeId = (select r.RecipeId from prs.Recipe as r where temp.t.[Number] = r.[Number]);
	update temp.u set RecipeId = (select r.RecipeId from prs.Recipe as r where temp.u.[Number] = r.[Number]);

	-- insert recipe revisions
	insert into prs.RecipeRevision ([RecipeId], [MajorRevision], [MinorRevision], [UpdateRevision], [CreationDate], [CreatedBy], [IsArchived], [IsDeleted], [BookLength], [BookWidth], [RevisionNote])
	select distinct
		u.RecipeId, 
		u.MajorRevision as MajorRevision,
		u.MinorRevision as MinorRevision,
		u.UpdateRevision,
		u.CreationDate,
		u.CreatedBy,
		u.IsArchived as IsArchived,
		u.IsDeleted as IsDeleted,
		u.BookLength,
		u.BookWidth,
		u.RevisionNote
	from temp.u u;
	select 'insert recipe revisions: ' || changes();

	-- propagate any new RecipeRevisionIds to our test data set
	update temp.u
	set RecipeRevisionId = (
		select rr.RecipeRevisionId
		from prs.RecipeRevision rr 
		where temp.u.RecipeId = rr.RecipeId
		and temp.u.MajorRevision = rr.MajorRevision
		and temp.u.MinorRevision = rr.MinorRevision
		and temp.u.UpdateRevision = rr.UpdateRevision);
	

	-- insert revision details
	insert into prs.RecipeDetail ([RecipeRevisionId], [StepNum], [PressureRampSP], [PressureRampTimeSP], [PressureHoldSP], [PressureHoldTimeSP], [TemperatureRampSP], [TemperatureRampTimeSP], [TemperatureHoldSP], [TemperatureHoldTimeSP], [BumpTime], [BumpTemperature], [SelectHeatCoolSegment])
	select
		u.RecipeRevisionId,
		u.StepNum,
		u.PressureRampSP,
		u.PressureRampTimeSP,
		u.PressureHoldSP,
		u.PressureHoldTimeSP,
		u.TemperatureRampSP,
		u.TemperatureRampTimeSP,
		u.TemperatureHoldSP,
		u.TemperatureHoldTimeSP,
		u.BumpTime,
		u.BumpTemperature,
		u.SelectHeatCoolSegment
	from
		temp.u u;
	select 'insert recipe details: ' || changes();

	-- propagate any new RecipeDetailIds to our test data set (not really necessary - not a value that is used)
	update temp.u
	set RecipeDetailId = (select rd.RecipeDetailId
		from prs.RecipeDetail rd
		where temp.u.RecipeRevisionId = rd.RecipeRevisionId
		and temp.u.StepNum = rd.StepNum);

	-- Set Active Revisions
	drop table if exists temp.v;
	create temporary table temp.v (RecipeId int, Number int, RecipeRevisionId int, MajorRevision int, MinorRevision int, UpdateRevision int);
	insert into temp.v (RecipeId, Number, MajorRevision, MinorRevision, UpdateRevision) select distinct rr.RecipeId, r.Number, rr.MajorRevision, rr.MinorRevision, rr.UpdateRevision from prs.RecipeRevision as rr inner join prs.Recipe as r on rr.RecipeId = r.RecipeId where r.Number in (select t.[Number] from temp.t as t);
	update temp.v set MajorRevision = (select max(rr.MajorRevision) from prs.RecipeRevision as rr where rr.RecipeId = temp.v.RecipeId and rr.IsArchived = 0 and rr.IsDeleted = 0);
	update temp.v set MinorRevision = (select max(rr.MinorRevision) from prs.RecipeRevision as rr where rr.RecipeId = temp.v.RecipeId and rr.MajorRevision = temp.v.MajorRevision and rr.IsArchived = 0 and rr.IsDeleted = 0);
	update temp.v set UpdateRevision = (select max(rr.UpdateRevision) from prs.RecipeRevision as rr where rr.RecipeId = temp.v.RecipeId and rr.MajorRevision = temp.v.MajorRevision and rr.MinorRevision = temp.v.MinorRevision and rr.IsArchived = 0 and rr.IsDeleted = 0);
	update temp.v set RecipeRevisionId = (select rr.RecipeRevisionId from prs.RecipeRevision as rr where rr.RecipeId = temp.v.RecipeId and rr.MajorRevision = temp.v.MajorRevision and rr.MinorRevision = temp.v.MinorRevision and rr.UpdateRevision = temp.v.UpdateRevision);
	update prs.Recipe set ActiveRevision = (select v.RecipeRevisionId from temp.v as v where prs.Recipe.RecipeId = v.RecipeId);
	select 'update active revisions: ' || changes();

	-- Tweaks to data set
	delete from prs.RecipeDetail
	where prs.RecipeDetail.RecipeDetailId in
	(
	select rd.RecipeDetailId from prs.RecipeDetail as rd
	inner join prs.RecipeRevision as rr
	on rr.RecipeRevisionId = rd.RecipeRevisionId
	inner join prs.Recipe as r
	on r.RecipeId = rr.RecipeId
	where
		r.[Number] in (547)
	);
	select 'tweaks(1): ' || changes();

